function Articles(){
    return (
        <ul>
            <li>
                <Link to="/articles/1"> 게시글1</Link>
            </li>
            <li>
                <Link to="/articles/1"> 게시글2</Link>
            </li>
            <li>
                <Link to="/articles/1"> 게시글3</Link>
            </li>
        </ul>
    );
};

export default Articles;
